import React from 'react';
import {Pagination} from "react-bootstrap";

const Pages = () => {
    const pages = [1, 2, 3, 4, 5]

    return (
        <Pagination className="mt-1">
            {pages.map(page =>
                <Pagination.Item key={page}>{page}</Pagination.Item>
            )}
        </Pagination>
    );
};

export default Pages;
